import { GoogleMap, PolygonF, useJsApiLoader } from '@react-google-maps/api';
import React, { useCallback, useRef } from 'react';

const containerStyle = {
  width: '100%',
  height: '600px',
};

// Center point set to Jharkhand level
const center = {
  lat: 23.6102,  // Latitude of Jharkhand
  lng: 85.2799,  // Longitude of Jharkhand
};

const zoomLevel = 6;  // Initial zoom level for a broader view

// Coordinates for the Jharkhand polygon
const jharkhandCoords = [
  { lat: 24.4366, lng: 84.2201 },
  { lat: 24.1851, lng: 85.0568 },
  { lat: 23.9867, lng: 85.6182 },
  { lat: 23.6255, lng: 86.4194 },
  { lat: 23.1986, lng: 86.8941 },
  { lat: 22.7767, lng: 86.6826 },
  { lat: 22.3571, lng: 85.9870 },
  { lat: 22.2786, lng: 85.3999 },
  { lat: 22.7027, lng: 84.8895 },
  { lat: 23.1097, lng: 84.6137 },
  { lat: 23.7197, lng: 84.4003 },
  { lat: 24.0020, lng: 84.4666 },
];

// Coordinates for the Ranchi polygon (updated)
const ranchiCoords = [
  { lat: 23.5000, lng: 85.4631 },
  { lat: 23.4811, lng: 85.4194 },
  { lat: 23.4275, lng: 85.4325 },
  { lat: 23.4092, lng: 85.4611 },
  { lat: 23.4114, lng: 85.4986 },
  { lat: 23.4381, lng: 85.5059 },
  { lat: 23.4653, lng: 85.5097 },
  { lat: 23.4919, lng: 85.5140 },
  { lat: 23.5075, lng: 85.4816 },
  { lat: 23.5041, lng: 85.4472 },
  { lat: 23.4905, lng: 85.4158 },
];

// Coordinates for the new polygon
const newPolygonCoords = [
  { lat: 23.4422, lng: 85.4495 },
  { lat: 23.4383, lng: 85.4625 },
  { lat: 23.4381, lng: 85.4700 },
  { lat: 23.4472, lng: 85.4706 },
  { lat: 23.4511, lng: 85.4675 },
  { lat: 23.4508, lng: 85.4589 },
  { lat: 23.4444, lng: 85.4562 },
];

// Coordinates for the additional new polygon
const additionalPolygonCoords = [
  { lat: 23.4455, lng: 85.4603 },
  { lat: 23.4453, lng: 85.4563 },
  { lat: 23.4441, lng: 85.4553 },
  { lat: 23.4400, lng: 85.4572 },
  { lat: 23.4400, lng: 85.4622 },
  { lat: 23.4411, lng: 85.4644 },
  { lat: 23.4417, lng: 85.4647 },
  { lat: 23.4422, lng: 85.4620 },
];

// Coordinates for the new polygon (the one you requested)
const newPolygonCoords2 = [
  { lat: 23.4432, lng: 85.4597 },  // 23°26'35"N 85°27'35"E
  { lat: 23.4436, lng: 85.4600 },  // 23°26'37"N 85°27'36"E
  { lat: 23.4436, lng: 85.4597 },  // 23°26'37"N 85°27'35"E
  { lat: 23.4436, lng: 85.4595 },  // 23°26'37"N 85°27'34"E
  { lat: 23.4435, lng: 85.4593 },  // 23°26'36"N 85°27'33"E
];
const newPolygonCoords3 = [
  { lat: 23.4425, lng: 85.4603 },  // 23°26'33"N 85°27'37"E
  { lat: 23.4428, lng: 85.4606 },  // 23°26'34"N 85°27'38"E
  { lat: 23.4429, lng: 85.4603 },  // 23°26'35"N 85°27'37"E
  { lat: 23.4428, lng: 85.4600 },  // 23°26'34"N 85°27'36"E
];
const newPolygonCoords4 = [
  { lat: 23.4428, lng: 85.4600 },  // 23°26'34"N 85°27'36"E
  { lat: 23.4429, lng: 85.4603 },  // 23°26'35"N 85°27'37"E
  { lat: 23.4433, lng: 85.4600 },  // 23°26'36"N 85°27'36"E
  { lat: 23.4429, lng: 85.4602 },  // 23°26'35"N 85°27'35"E
];
const MapComponent = () => {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyChN074R5gt4BfPTFox9UXnND0S8yyH6Dk",
  });

  const mapRef = useRef(null);

  const onLoad = useCallback((mapInstance) => {
    console.log("Map loaded:", mapInstance);
    mapRef.current = mapInstance;
  }, []);

  const handlePolygonClick = useCallback((polygonCoords) => {
    const map = mapRef.current;
    if (!map) {
      console.log("Map instance not available.");
      return;
    }

    console.log("Polygon clicked, zooming in...");

    const bounds = new window.google.maps.LatLngBounds();
    polygonCoords.forEach(coord => bounds.extend(coord));

    map.fitBounds(bounds);
  }, []);

  return isLoaded ? (
    <div style={{ position: 'relative' }}>
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={zoomLevel}
        onLoad={onLoad}
      >
        {/* Jharkhand Polygon */}
        <PolygonF
          paths={jharkhandCoords}
          options={{
            fillColor: '#00FF00',
            strokeColor: '#000000',
            fillOpacity: 0.5,
          }}
          onClick={() => {
            console.log("Jharkhand polygon clicked");
            handlePolygonClick(jharkhandCoords);
          }}
        />

        {/* Ranchi Polygon */}
        <PolygonF
          paths={ranchiCoords}
          options={{
            fillColor: '#FF5733',
            strokeColor: '#000000',
            fillOpacity: 0.5,
          }}
          onClick={() => {
            console.log("Ranchi polygon clicked");
            handlePolygonClick(ranchiCoords);
          }}
        />

        {/* New Polygon */}
        <PolygonF
          paths={newPolygonCoords}
          options={{
            fillColor: '#0000FF',
            strokeColor: '#000000',
            fillOpacity: 0.5,
          }}
          onClick={() => {
            console.log("New polygon clicked");
            handlePolygonClick(newPolygonCoords);
          }}
        />

        {/* Additional New Polygon */}
        <PolygonF
          paths={additionalPolygonCoords}
          options={{
            fillColor: '#0000FF',
            strokeColor: '#000000',
            fillOpacity: 0.2,
          }}
          onClick={() => {
            console.log("Additional polygon clicked");
            handlePolygonClick(additionalPolygonCoords);
          }}
        />

        {/* New Polygon (Additional) */}
        <PolygonF
          paths={newPolygonCoords2}
          options={{
            fillColor: '#FF00FF',
            strokeColor: '#000000',
            fillOpacity: 0.5,
          }}
          onClick={() => {
            console.log("New Polygon 2 clicked");
            handlePolygonClick(newPolygonCoords2);
          }}
        />
         <PolygonF
          paths={newPolygonCoords3}
          options={{
            fillColor: '#FF00FF',
            strokeColor: '#000000',
            fillOpacity: 0.5,
          }}
          onClick={() => {
            console.log("New Polygon 2 clicked");
            handlePolygonClick(newPolygonCoords3);
          }}
        />
        <PolygonF
  paths={newPolygonCoords4}
  options={{
    fillColor: '#FF00FF',  // You can set any color
    strokeColor: '#000000',
    fillOpacity: 0.5,
  }}
  onClick={() => {
    console.log("New Polygon 4 clicked");
    handlePolygonClick(newPolygonCoords4);  // Zoom into the new polygon
  }}
/>
      </GoogleMap>
    </div>
  ) : <></>;
};

export default MapComponent;
